        // Search functionality
        document.getElementById('search').addEventListener('input', function(e) {
            var searchTerm = e.target.value.toLowerCase();
            
            // Filter sidebar items
            document.querySelectorAll('#images-list .image-item').forEach(item => {
                var text = item.textContent.toLowerCase();
                item.style.display = text.includes(searchTerm) ? 'flex' : 'none';
            });
            
            // Filter markers
            markersList.forEach(item => {
                var marker = item.marker;
                var match = item.id.toLowerCase().includes(searchTerm) || 
                            item.camera.toLowerCase().includes(searchTerm) || 
                            item.date.toLowerCase().includes(searchTerm);
                
                if (match) {
                    map.addLayer(marker);
                } else {
                    map.removeLayer(marker);
                }
            });
        });
        
        // Click event for sidebar items
        document.querySelectorAll('#images-list .image-item').forEach(item => {
            item.addEventListener('click', function() {
                var id = this.getAttribute('data-id');
                var marker = markersList.find(m => m.id === id).marker;
                
                // Close any open popups
                map.closePopup();
                
                // Fly to marker and open popup
                map.flyTo(marker.getLatLng(), 15, {
                    duration: 1
                });
                
                setTimeout(() => {
                    marker.openPopup();
                }, 1000);
            });
        });
        
        // Highlight marker when hovering sidebar items
        document.querySelectorAll('#images-list .image-item').forEach(item => {
            item.addEventListener('mouseover', function() {
                var id = this.getAttribute('data-id');
                var marker = markersList.find(m => m.id === id).marker;
                marker.setZIndexOffset(1000);
            });
            
            item.addEventListener('mouseout', function() {
                var id = this.getAttribute('data-id');
                var marker = markersList.find(m => m.id === id).marker;
                marker.setZIndexOffset(0);
            });
        });
